Begin your life anew after a painful break up and do everything to find your true love. Yes, you will be surrounded by amazing girls but the way to their hearts won't be as simple as you think - especially taking into account that you're broke and currently without a job.

If you want to succeed use your connections to find a new source of income, get a grip, start to work on yourself and begin dating.

You can find 3 alluring girls here - each one with their own personality and desires. Become part of their lives and make the right choices to influence the way they perceive you. Some of them want to see a true friend in you, some of the, just want a great party companion. Can you meet their expectations? Or maybe you are determined enough to stay yourself and change them according to your will?
